import "./coin.css"

export default function coin({name,icon,price,symbol}) {
  return (
    <div className="coin">
        <h1 className="name">{name}</h1>
        <img src={icon} className="img"/>
        <h5>Current </h5>
        <h3>{price} </h3>
        <h3>{symbol}</h3>
    </div>
  )
}
